# Define Models
class SessionCreate(BaseModel):
    specialty: str

class Session(BaseModel):
    id: str = Field(default_factory=lambda: str(uuid.uuid4()))
    specialty: str
    scenario: str
    patient_info: Dict[str, Any]
    current_stage: str = "diagnosis"  # diagnosis, completed
    diagnosis_attempts: int = 0
    total_cost: float = 0.0
    total_points: int = 0
    created_at: datetime = Field(default_factory=lambda: datetime.now(timezone.utc))
    chat_history: List[Dict[str, Any]] = []
    correct_diagnosis: Optional[str] = None
    recommended_tests: List[Dict[str, Any]] = []

class ChatMessage(BaseModel):
    session_id: str
    message: str

class DiagnosisRequest(BaseModel):
    session_id: str
    diagnosis: str

class TestRequest(BaseModel):
    session_id: str
    test_type: str
    body_part: Optional[str] = None

# Initialize Google Gen AI
def get_llm_chat(session_id: str, system_message: str):
    genai.configure(api_key=os.environ.get('GOOGLE_API_KEY'))
    model = genai.GenerativeModel('gemini-2.0-flash')
    return model, system_message

def prepare_for_mongo(data):
    if isinstance(data, dict):
        for key, value in data.items():
            if isinstance(value, datetime):
                data[key] = value.isoformat()
            elif isinstance(value, dict):
                prepare_for_mongo(value)
            elif isinstance(value, list):
                for item in value:
                    if isinstance(item, dict):
                        prepare_for_mongo(item)
    return data

def parse_from_mongo(item):
    if isinstance(item, dict):
        for key, value in item.items():
            if key == 'created_at' and isinstance(value, str):
                try:
                    item[key] = datetime.fromisoformat(value)
                except:
                    pass
            elif isinstance(value, dict):
                parse_from_mongo(value)
            elif isinstance(value, list):
                for sub_item in value:
                    if isinstance(sub_item, dict):
                        parse_from_mongo(sub_item)
    return item

def format_markdown_response(text: str) -> str:
    """Format AI response with markdown for better readability"""
    # Add markdown formatting to common medical patterns
    
    # Bold important medical terms
    text = re.sub(r'\b(CORRECT_DIAGNOSIS|STUDENT_CORRECT|FEEDBACK|DIAGNOSIS|FINDINGS|SYMPTOMS|TREATMENT)\b', r'**\1**', text)
    
    # Format lists
    text = re.sub(r'^\s*(\d+)\.\s+', r'\n\1. ', text, flags=re.MULTILINE)
    text = re.sub(r'^\s*[-*]\s+', r'\n- ', text, flags=re.MULTILINE)
    
    # Format sections
    text = re.sub(r'^([A-Z][A-Z\s]{2,}):(.*)$', r'\n## \1\n\2', text, flags=re.MULTILINE)
    
    # Add emphasis for key medical findings
    medical_terms = ['pain', 'fever', 'nausea', 'vomiting', 'shortness of breath', 'chest pain', 'headache', 'dizziness']
    for term in medical_terms:
        text = re.sub(f'\\b({term})\\b', r'*\1*', text, flags=re.IGNORECASE)
    
    return text.strip()

def evaluate_test_appropriateness(scenario: str, test_type: str, body_part: str) -> tuple[bool, int, str]:
    """Evaluate if the requested test is appropriate for the scenario"""
    # This is a simplified evaluation - in a real system, this would be more sophisticated
    scenario_lower = scenario.lower()
    test_lower = test_type.lower()
    body_part_lower = body_part.lower() if body_part else ""
    
    # Define some basic appropriateness rules
    appropriate_combinations = {
        "chest pain": ["x-ray:chest", "ecg", "echo", "ct_scan:chest"],
        "shortness of breath": ["x-ray:chest", "ct_scan:chest", "echo"],
        "headache": ["ct_scan:head", "mri:brain"],
        "knee pain": ["x-ray:knee", "mri:knee"],
        "abdominal pain": ["ultrasound:abdomen", "ct_scan:abdomen", "blood_test"],
        "back pain": ["x-ray:spine", "mri:spine"],
        "heart": ["ecg", "echo", "x-ray:chest"]
    }
    
    # Check if test is appropriate
    is_appropriate = False
    reasoning = ""
    
    for condition, tests in appropriate_combinations.items():
        if condition in scenario_lower:
            test_combo = f"{test_lower}:{body_part_lower}" if body_part_lower else test_lower
            if test_combo in tests or test_lower in tests:
                is_appropriate = True
                reasoning = f"Appropriate test for suspected {condition}"
                break
    
    if not is_appropriate:
        reasoning = "This test may not be the most appropriate for the current presentation"
    
    points = SCORING_RULES["correct_test_order"] if is_appropriate else SCORING_RULES["incorrect_test_order"]
    
    return is_appropriate, points, reasoning

@api_router.post("/session", response_model=Session)
async def create_session(session_create: SessionCreate):
    # Create scenario generation prompt
    scenario_prompt = f"""
    You are a medical education AI. Generate a realistic patient scenario for a {session_create.specialty} case.
    
    Create a detailed patient presentation including:
    1. Patient demographics (age, gender)
    2. Chief complaint
    3. History of present illness
    4. Relevant medical history
    5. Initial physical examination findings
    
    Also, identify:
    - The correct diagnosis for this case
    - 3-5 recommended tests that would help confirm the diagnosis
    
    Format your response as:
    **SCENARIO:**
    [Detailed scenario here]
    
    **CORRECT_DIAGNOSIS:**
    [The correct diagnosis]
    
    **RECOMMENDED_TESTS:**
    - Test 1: Reason
    - Test 2: Reason
    - Test 3: Reason
    
    Make it challenging but realistic for medical students.
    """
    
    try:
        # Generate scenario using Gemini
        model, system_prompt = get_llm_chat(str(uuid.uuid4()), scenario_prompt)
        full_prompt = f"{system_prompt}\n\nGenerate a {session_create.specialty} case scenario."
        scenario_response = model.generate_content(full_prompt).text
        
        # Parse the response to extract scenario, diagnosis, and recommended tests
        scenario_parts = scenario_response.split("**CORRECT_DIAGNOSIS:**")
        scenario_text = scenario_parts[0].replace("**SCENARIO:**", "").strip()
        
        correct_diagnosis = ""
        recommended_tests = []
        
        if len(scenario_parts) > 1:
            diag_and_tests = scenario_parts[1].split("**RECOMMENDED_TESTS:**")
            correct_diagnosis = diag_and_tests[0].strip()
            
            if len(diag_and_tests) > 1:
                tests_text = diag_and_tests[1].strip()
                for line in tests_text.split('\n'):
                    if line.strip().startswith('-'):
                        recommended_tests.append({"test": line.strip()})
        
        # Create session
        session_data = {
            "specialty": session_create.specialty,
            "scenario": scenario_text,
            "patient_info": {"generated": True},
            "current_stage": "diagnosis",
            "diagnosis_attempts": 0,
            "total_cost": 0.0,
            "total_points": 0,
            "created_at": datetime.now(timezone.utc),
            "chat_history": [],
            "correct_diagnosis": correct_diagnosis,
            "recommended_tests": recommended_tests
        }
        
        session = Session(**session_data)
        session_dict = prepare_for_mongo(session.dict())
        await db.sessions.insert_one(session_dict)
        
        return session
        
    except Exception as e:
        raise HTTPException(status_code=500, detail=f"Error creating session: {str(e)}")

@api_router.get("/session/{session_id}", response_model=Session)
async def get_session(session_id: str):
    session = await db.sessions.find_one({"id": session_id})
    if not session:
        raise HTTPException(status_code=404, detail="Session not found")
    
    session = parse_from_mongo(session)
    return Session(**session)

@api_router.post("/chat")
async def chat_with_doctor(chat_message: ChatMessage):
    # Get session
    session = await db.sessions.find_one({"id": chat_message.session_id})
    if not session:
        raise HTTPException(status_code=404, detail="Session not found")
    
    session = parse_from_mongo(session)
    
    # Create doctor AI prompt
    doctor_prompt = f"""
    You are an experienced medical professional evaluating a medical student's approach to diagnosis.
    
    Current case: {session['scenario']}
    
    The student has said: "{chat_message.message}"
    
    Respond as a helpful attending physician would:
    1. If they're asking for tests/imaging, acknowledge the request but don't provide results yet
    2. If they're on the right track, encourage them with markdown formatting
    3. If they're missing something important, give subtle hints
    4. Use markdown formatting for better readability (bold, italics, lists)
    5. If they request specific tests, respond with something like "Let me order that test for you. The results will be available shortly."
    
    Format your response with markdown:
    - Use **bold** for important medical terms
    - Use *italics* for symptoms
    - Use numbered lists for recommendations
    - Use bullet points for differential diagnoses
    
    Don't give away the diagnosis directly. Guide them through the thinking process.
    """
    
    try:
        # Get AI response
        model, system_prompt = get_llm_chat(chat_message.session_id, doctor_prompt)
        full_prompt = f"{system_prompt}\n\nStudent message: {chat_message.message}"
        ai_response = model.generate_content(full_prompt).text
        
        # Format response with markdown
        formatted_response = format_markdown_response(ai_response)
        
        # Evaluate if this is a good question (simple heuristic)
        points_earned = 0
        if any(word in chat_message.message.lower() for word in ['test', 'exam', 'symptom', 'history', 'pain', 'diagnostic']):
            points_earned = SCORING_RULES["helpful_question"]
        elif len(chat_message.message.strip()) < 10:
            points_earned = SCORING_RULES["irrelevant_question"]
        else:
            points_earned = SCORING_RULES["helpful_question"]
        
        # Update points
        session['total_points'] += points_earned
        
        # Update chat history
        session['chat_history'].append({
            "type": "user",
            "message": chat_message.message,
            "points_earned": points_earned,
            "timestamp": datetime.now(timezone.utc).isoformat()
        })
        session['chat_history'].append({
            "type": "doctor",
            "message": formatted_response,
            "timestamp": datetime.now(timezone.utc).isoformat()
        })
        
        # Update session in database
        session_dict = prepare_for_mongo(session)
        await db.sessions.update_one(
            {"id": chat_message.session_id},
            {"$set": session_dict}
        )
        
        return {
            "response": formatted_response,
            "points_earned": points_earned,
            "total_points": session['total_points']
        }
        
    except Exception as e:
        raise HTTPException(status_code=500, detail=f"Error processing chat: {str(e)}")

@api_router.post("/request-test")
async def request_test(test_request: TestRequest):
    # Get session
    session = await db.sessions.find_one({"id": test_request.session_id})
    if not session:
        raise HTTPException(status_code=404, detail="Session not found")
    
    session = parse_from_mongo(session)
    
    # Evaluate test appropriateness
    is_appropriate, points_earned, reasoning = evaluate_test_appropriateness(
        session['scenario'], 
        test_request.test_type, 
        test_request.body_part or ""
    )
    
    # Calculate cost
    cost = 0
    test_type = test_request.test_type.lower()
    body_part = test_request.body_part.lower() if test_request.body_part else None
    
    if test_type in MEDICAL_COSTS:
        if isinstance(MEDICAL_COSTS[test_type], dict) and body_part:
            cost = MEDICAL_COSTS[test_type].get(body_part, 200)  # Default cost
        elif isinstance(MEDICAL_COSTS[test_type], int):
            cost = MEDICAL_COSTS[test_type]
        else:
            cost = 200  # Default cost
    
    # Get image if available
    image_url = None
    if test_type in MEDICAL_IMAGES and body_part in MEDICAL_IMAGES[test_type]:
        image_url = MEDICAL_IMAGES[test_type][body_part]
    elif test_type in MEDICAL_IMAGES:
        # Get first available image for this test type
        available_images = MEDICAL_IMAGES[test_type]
        if available_images:
            image_url = list(available_images.values())[0]
    
    # Generate test results using AI
    results_prompt = f"""
    Generate realistic medical test results for a {test_type} of the {body_part if body_part else 'requested area'} 
    based on this patient scenario: {session['scenario']}
    
    Provide realistic findings that would help with diagnosis. Include technical medical terminology 
    but also make it educational for medical students. If this is imaging, describe what would be visible.
    If this is lab work, provide realistic values.
    
    Format your response with markdown:
    - Use **bold** for key findings
    - Use *italics* for normal/abnormal values
    - Use bullet points for multiple findings
    - Include interpretation when appropriate
    
    Keep it concise but medically accurate.
    """
    
    try:
        model, system_prompt = get_llm_chat(test_request.session_id, results_prompt)
        full_prompt = f"{system_prompt}\n\nGenerate {test_type} results for {body_part}"
        test_results = model.generate_content(full_prompt).text
        
        # Format results with markdown
        formatted_results = format_markdown_response(test_results)
        
        # Update session cost and points
        session['total_cost'] += cost
        session['total_points'] += points_earned
        
        # Add to chat history
        session['chat_history'].append({
            "type": "test_result",
            "test_type": test_type,
            "body_part": body_part,
            "results": formatted_results,
            "cost": cost,
            "points_earned": points_earned,
            "is_appropriate": is_appropriate,
            "reasoning": reasoning,
            "image_url": image_url,
            "timestamp": datetime.now(timezone.utc).isoformat()
        })
        
        # Update session in database
        session_dict = prepare_for_mongo(session)
        await db.sessions.update_one(
            {"id": test_request.session_id},
            {"$set": session_dict}
        )
        
        return {
            "results": formatted_results,
            "cost": cost,
            "total_cost": session['total_cost'],
            "points_earned": points_earned,
            "total_points": session['total_points'],
            "is_appropriate": is_appropriate,
            "reasoning": reasoning,
            "image_url": image_url
        }
        
    except Exception as e:
        raise HTTPException(status_code=500, detail=f"Error processing test request: {str(e)}")

@api_router.post("/submit-diagnosis")
async def submit_diagnosis(diagnosis_request: DiagnosisRequest):
    # Get session
    session = await db.sessions.find_one({"id": diagnosis_request.session_id})
    if not session:
        raise HTTPException(status_code=404, detail="Session not found")
    
    session = parse_from_mongo(session)

    def normalize_text(text: str) -> set:
        """Metni kk harfe evirir, noktalamay kaldrr ve kelimelerden oluan bir set dndrr."""
        # 1. Kk harfe evir
        text = text.lower()
        # 2. Parantez, virgl vb. tm noktalama iaretlerini bolukla deitir
        text = re.sub(r'[^\w\s]', ' ', text)
        # 3. Kelimelere ayr ve bo olanlar filtrele
        words = set(text.split())
        return words

    # Tehis metinlerini normalize et
    correct_diagnosis_words = normalize_text(session.get('correct_diagnosis', ''))
    student_diagnosis_words = normalize_text(diagnosis_request.diagnosis)

    # ki kelime seti tamamen ayn ise veya biri dierinin alt kmesi ise doru kabul et.
    # Bu, "(Koksartroz)" gibi ek bilgileri tolere eder.
    is_correct = (student_diagnosis_words == correct_diagnosis_words or 
                  student_diagnosis_words.issubset(correct_diagnosis_words) or 
                  correct_diagnosis_words.issubset(student_diagnosis_words))

  
    evaluation_prompt = f"""
    You are a medical education AI evaluating a student's diagnosis.
    
    Case scenario: {session['scenario']}
    Correct diagnosis: {session.get('correct_diagnosis', 'Unknown')}
    
    Student's diagnosis: {diagnosis_request.diagnosis}
    
    Evaluate the student's diagnosis and provide detailed educational feedback.
    
    Format your response with markdown:
    
    ## **DIAGNOSIS EVALUATION**
    
    **Student Diagnosis:** {diagnosis_request.diagnosis}
    
    **Correct Diagnosis:** {session.get('correct_diagnosis', 'Unknown')}
    
    **Assessment:** {"Correct" if is_correct else "Incorrect"}
    
    
    ## **DETAILED FEEDBACK**
    
    ### **What you got right:**
    - [Point 1]
    - [Point 2]
    
    ### **Areas for improvement:**
    - [Point 1]
    - [Point 2]
    
    ### **Key learning points:**
    1. [Learning point 1]
    2. [Learning point 2]
    
    ### **Recommended next steps:**
    - [Recommendation 1]
    - [Recommendation 2]
    
    Provide constructive, educational feedback that helps the student learn.
    """
    
    try:
        model, system_prompt = get_llm_chat(diagnosis_request.session_id, evaluation_prompt)
        full_prompt = f"{system_prompt}\n\nEvaluate diagnosis: {diagnosis_request.diagnosis}"
        evaluation = model.generate_content(full_prompt).text
        
        formatted_evaluation = format_markdown_response(evaluation)
        
        # Calculate points
        points_earned = SCORING_RULES["correct_diagnosis"] if is_correct else SCORING_RULES["incorrect_diagnosis"]
        
        # Update session
        session['diagnosis_attempts'] += 1
        session['current_stage'] = "completed"
        session['total_points'] += points_earned
        
        # Add to chat history
        session['chat_history'].append({
            "type": "diagnosis_submission",
            "diagnosis": diagnosis_request.diagnosis,
            "evaluation": formatted_evaluation,
            "is_correct": is_correct,
            "points_earned": points_earned,
            "attempt_number": session['diagnosis_attempts'],
            "timestamp": datetime.now(timezone.utc).isoformat()
        })
        
        # Update session in database
        session_dict = prepare_for_mongo(session)
        await db.sessions.update_one(
            {"id": diagnosis_request.session_id},
            {"$set": session_dict}
        )
        
        return {
            "evaluation": formatted_evaluation,
            "is_correct": is_correct,
            "points_earned": points_earned,
            "total_points": session['total_points'],
            "attempt_number": session['diagnosis_attempts'],
            "total_cost": session['total_cost']
        }
        
    except Exception as e:
        raise HTTPException(status_code=500, detail=f"Error evaluating diagnosis: {str(e)}")

